INSERT INTO `cropplanning` (`cropID`, `startDate`, `endDate`, `description`, `status`, `crop_planning_id`) VALUES
(1, '2024-04-18', '2024-05-17', 'Prepare the land by plowing and harrowing to create a smooth and loose seedbed. Choose a sunny location with well-draining soil.', 1, 20),
(1, '2024-05-18', '2024-06-01', 'Plant wheat seeds at a depth of 2-3 cm and a density of 100-120 kg of seeds per hectare.', 0, 21),
(1, '2024-06-02', '2024-06-16', 'Apply a starter fertilizer that contains nitrogen, phosphorus, and potassium at a rate of 50-60 kg/ha.', 0, 22),
(1, '2024-06-17', '2024-07-16', 'Irrigate the field if there is no sufficient rainfall, maintaining soil moisture for optimal growth.', 0, 23),
(1, '2024-07-17', '2024-08-15', 'Weed control should be done regularly to prevent yield reduction. Use selective herbicides.', 0, 24),
(1, '2024-08-16', '2024-09-14', 'Apply top-dressing fertilizer at a rate of 40-50 kg/ha of nitrogen to boost yield.', 0, 25),
(1, '2024-09-15', '2024-10-14', 'Monitor the crop for any signs of diseases or pests. Use appropriate fungicides or pesticides if necessary.', 0, 26),
(1, '2024-10-15', '2024-11-13', 'Harvest the crop when the wheat kernels have turned golden brown and the moisture content is around 14-15%. This is usually 4-5 months after planting.', 0, 27),
(18, '2024-04-19', '2024-05-18', 'Prepare the land by clearing weeds and tilling the soil. Soybean seeds should be planted 2.5 cm deep into the soil, with a spacing of 5 cm between seeds and 30 cm between rows. Plant 120 kg of seeds per hectare.', 1, 48),
(18, '2024-05-19', '2024-06-17', 'Apply a starter fertilizer that is high in phosphorus and potassium, such as a 10-20-20 fertilizer, at a rate of 200 kg per hectare. This will help promote strong root growth and early plant development.', 0, 49),
(18, '2024-06-18', '2024-07-17', 'As the plants grow, they will need additional nutrients. Apply a fertilizer that is high in nitrogen, such as a 20-0-0 fertilizer, at a rate of 100 kg per hectare. This will help promote foliage growth and increase yield.', 0, 50),
(18, '2024-07-18', '2024-08-16', 'Keep the field free of weeds by using mechanical or chemical methods. Be careful when using herbicides, as soybeans are sensitive to some chemicals.', 0, 51),
(18, '2024-08-17', '2024-09-15', 'Monitor the crop for any signs of disease or pests. If detected, use appropriate controls.', 0, 52),
(18, '2024-09-16', '2024-10-15', 'Soybeans reach maturity around 120-150 days after planting, depending on the variety. At this point, the leaves will begin to turn yellow and the pods will begin to dry out. Harvest the soybeans when the moisture content is around 14-15%.It is important to note that the above plan is a general guideline, and may need to be adjusted based on local conditions such as soil type, weather, and pest pressure. Always consult with a local agricultural extension service for specific recommendations for your area.', 0, 53);

