(' ActiasSeleneNingpoanaFelder', 'Chemical Control', 2, 19, '', '', '2024-04-19', 'Actias Selene Ningpoana Felder, also known as the Chinese Moon Moth, is a pale gray-green moth with distinctive eyespots on its hindwings. It has a wingspan of 3-4 inches and is native to Asia. The larvae feed on various trees and shrubs.', 1, 0.000, ' Use insecticides specific to Actias Selene Ningpoana Felder, taking care to follow label instructions and consider potential non-target impacts. Rotate insecticides to prevent resistance.', );
